import React, { useState } from "react";
import AddSupportTicket from "./addTicket";
import SupportTicketBrowse from "./browse";
const SupportTicketIndex = () => {
  const [selectedIndex, setSeletedIndex] = useState(0);
  const handleIndex = (index) => {
    setSeletedIndex(index);
  };
  return (
    <div className="card card-custom gutter-b  px-7 py-3">
      <ul className="nav nav-tabs nav-tabs-line">
        <li className="nav-item">
          <a

            className={`nav-link ` + (selectedIndex === 0 ? "active" : "")}
            onClick={() => {
              // dispatch(clearSelectedGodownId());
              handleIndex(0);
            }}
          >
            Browse
          </a>
        </li>
        <li className="nav-item">
          <a

            className={`nav-link ` + (selectedIndex === 1 ? "active" : "")}
            onClick={() => {
              // dispatch(clearSelectedGodownId());
              handleIndex(1);
            }}
          >
            New Ticket
          </a>
        </li>
      </ul>
      <div className="tab-content">
        {selectedIndex === 0 ? <SupportTicketBrowse /> : <AddSupportTicket />}
      </div>
    </div>
  );
};

export default SupportTicketIndex;
